import { faTimesCircle } from '@fortawesome/free-solid-svg-icons'
import { font } from '../Utils/FontAwesome';
export default function Modal(){
return (
<div className="Modal">

<div className="Modal-Content">
<span className="close">{font(faTimesCircle)}</span>

</div>

</div>
); 
}
